import React from 'react';
import {Link} from 'react-router-dom';
import EditIcon from '@material-ui/icons/Edit';
import MetarialSpinner from '../Locations/MetarialSpinner';

const DeviceList = (props) => {
    const {model, SerialNumber, alarm1, key, format} = props.data
    return (
        <div data-aos="fade-left"  className="clients d-flex justify-content-evenly mb-5">
                    <div className="form-name">{model && <span><MeaSpinner/></span>}<p className="form-name-p">{device3.model}</p></div>
                     
                    <div title="Edit" className="meta_icon">
                    <EditIcon />
                    </div>
                    <Link title="select" to={`/locationsDevice/${key}/device/${format}/${key}`}  className="meta_icon2"><ArrowForwardIcon/></Link>
                </div>
    );
};

export default DeviceList;
